import React from 'react'
import { NavLink, Outlet } from 'react-router-dom'

const IndexData = () => {
  return (
    <div>

    <NavLink to="/home">Home</NavLink>
    <NavLink to='/home2'>about</NavLink>
    <NavLink to='/home3'>contact</NavLink>

    <Outlet />
    </div>

    )
}

export default IndexData
